import React from 'react';
import s from './Profile.module.css';

const Profile = (props) => {
    var Inter=()=>{
        for (i in props.profilePage.interests){
            return props.profilePage.interests[i]
        }
    }
    return (
        <div>
            <div className={s.descriptionBlock}>
               <div>Имя пользователя: {props.profilePage.name}</div>
                <div>Рейтинг: {props.profilePage.rating}</div>
                <div>Интересы: Наука, Кино, Путешествия</div>

            </div>
        </div>
    )
}


export default Profile;
